import React from 'react'
import  './styles.css'

 export default function index() {
    return(
        <div className="container">
            <div className="time">80</div>
            <div className="button-wrap"></div>
             <button className='button btn-start'>Start</button>
             <button className='button btn-stop'>Stop</button>
        </div>
    )
}
